import React, {useState} from "react";
import { Outlet, Link } from "react-router-dom";

export default function chooseGamemode(){



    return(
        <>
        
            <h1 className="title" id="title-main">Choose Gamemode</h1>

            <div className="page-bottom">
            <Link to="/EasyMode"><button className="play-btn">Easy</button></Link>
            <Link to="/HardMode"><button className="play-btn">Hard</button></Link>
            <Link to="/InsaneMode"><button className="play-btn">Insane</button></Link>

                <Link to="/"><button id="back-btn" className="play-btn">Back</button></Link>

            </div>
        </>
    )
}
